import './css/style.css';
import { datauser } from './data';
import DataCount from "./componenets/datacount"
import Listuser from './componenets/listUser';
import Btn from './componenets/btn';

const App = () => {
      const [personData, setPersonData] = useState(datauser)
      //dafadf
      const onDelete = () => {
        setPersonData([])
      }
      const onViewData = () => {
        setPersonData(datauser)
      }


      return (
            <div>
                  <div className='container'>
                     <DataCount person={personData}/>
                        <Listuser person={personData}></Listuser>
                        <Btn evantdelete={onDelete} evantviewData={onViewData}></Btn>
                  </div>
            </div>
      )
}


export default App
